import React from 'react';
import './getprediction.css';

export default function GetPrediction() {
    return (
        <div className="prediction-container">
            <h1>Get Prediction</h1>
            <p>Receive personalized predictions and insights about your kidney health with our advanced prediction tool.</p>
            <p>Our prediction algorithm analyzes various features to provide accurate assessments of kidney function and potential risks.</p>
            <p>Get started by filling out our questionnaire and receive instant feedback on your kidney health status.</p>
            <button className="prediction-button">Start Prediction</button>
        </div>
    );
}
